        this.words_s = this.add.image(250 + 26, 275 + 37, 'words_s');
        // this.words_s.visible = false

        // this.lock1 = this.add.image(250 + 26, 275 + 37, 'lock1').setInteractive();
        // this.lock2 = this.add.image(250 + 26, 275 + 37, 'lock2').setInteractive();
        // this.lock2.visible = false


        this.hook = this.add.image(270, 640, 'hook').setOrigin(0, 0);
        // this.hook.rotation = -1.5
